import { Route, Routes } from 'react-router-dom';
import './App.css';
import FeatureList from './components/FeatureList';
import Navbar from './components/Navbar';

function App() {
  return (
    <Routes>
      <Route path="/" element={
        <>
        <Navbar/>
        <FeatureList/>
        </>}/>
    </Routes>
  );
}

export default App;
